import React, { useState } from 'react';
import {
  Box,
  TextField,
  Button,
  Typography,
  Grid,
  Paper,
  Alert,
  Collapse
} from '@mui/material';
import { Calculate } from '@mui/icons-material';

const CMVCalculator = () => {
  const [inputs, setInputs] = useState({
    materiaPrima: '',
    maoDeObra: '',
    outrosCustos: '',
    quantidade: '',
  });

  const [cmv, setCmv] = useState(null);
  const [error, setError] = useState('');

  const handleChange = (event) => {
    const { name, value } = event.target;
    setInputs((prevInputs) => ({
      ...prevInputs,
      [name]: value,
    }));
  };

  const handleCalculate = () => {
    const { materiaPrima, maoDeObra, outrosCustos, quantidade } = inputs;

    if (!materiaPrima || !maoDeObra || !outrosCustos || !quantidade) {
      setError('Por favor, preencha todos os campos.');
      setCmv(null);
      return;
    }

    const totalCost =
      parseFloat(materiaPrima) +
      parseFloat(maoDeObra) +
      parseFloat(outrosCustos);

    const cmvResult = totalCost / parseInt(quantidade);

    if (isNaN(cmvResult) || !isFinite(cmvResult)) {
        setError('Valores inválidos. Verifique os números digitados.');
        setCmv(null);
        return;
    }


    setCmv(cmvResult.toFixed(2));
    setError('');
  };

  return (
    <Paper elevation={3} sx={{ p: 4, borderRadius: 2 }}>
      <Typography variant="h4" gutterBottom align="center" color="text.primary">
        Calculadora de CMV
      </Typography>
      <Typography variant="subtitle1" gutterBottom align="center" color="text.secondary" sx={{ mb: 4 }}>
        Preencha os custos e a quantidade vendida para calcular seu CMV unitário.
      </Typography>

      <Grid container spacing={3}>
        <Grid item xs={12} sm={6}>
          <TextField
            fullWidth
            label="Matéria-prima (R$)"
            name="materiaPrima"
            type="number"
            variant="outlined"
            placeholder="Ex: 5.00"
            value={inputs.materiaPrima}
            onChange={handleChange}
          />
        </Grid>
        <Grid item xs={12} sm={6}>
          <TextField
            fullWidth
            label="Mão de obra direta (R$)"
            name="maoDeObra"
            type="number"
            variant="outlined"
            placeholder="Ex: 3.00"
            value={inputs.maoDeObra}
            onChange={handleChange}
          />
        </Grid>
        <Grid item xs={12} sm={6}>
          <TextField
            fullWidth
            label="Outros custos diretos (R$)"
            name="outrosCustos"
            type="number"
            variant="outlined"
            placeholder="Ex: 2.00"
            value={inputs.outrosCustos}
            onChange={handleChange}
          />
        </Grid>
        <Grid item xs={12} sm={6}>
          <TextField
            fullWidth
            label="Quantidade vendida"
            name="quantidade"
            type="number"
            variant="outlined"
            placeholder="Ex: 100"
            value={inputs.quantidade}
            onChange={handleChange}
          />
        </Grid>
      </Grid>

      <Box sx={{ mt: 4, display: 'flex', justifyContent: 'center' }}>
        <Button
          variant="contained"
          color="secondary"
          size="large"
          startIcon={<Calculate />}
          onClick={handleCalculate}
          sx={{ color: 'white', fontWeight: 'bold' }}
        >
          Calcular
        </Button>
      </Box>

      <Collapse in={!!error}>
        <Alert severity="error" sx={{ mt: 3 }}>
          {error}
        </Alert>
      </Collapse>

      {cmv !== null && (
        <Box sx={{ mt: 4, p: 3, borderRadius: 2, backgroundColor: 'background.default', textAlign: 'center' }}>
          <Typography variant="h6" color="text.secondary">
            Seu Custo de Mercadoria Vendida (unitário) é:
          </Typography>
          <Typography variant="h3" color="primary" sx={{ fontWeight: 'bold' }}>
            R$ {cmv}
          </Typography>
        </Box>
      )}
    </Paper>
  );
};

export default CMVCalculator;
